// QueryString => query property on the request object
// localhost:3000/person?name=Hamza&age10
let options = {
    root: __dirname + '../../../public/',
    headers: {
        'x-timestamp': Date.now(),
        'x-sent': true
    }
}
const fileName = `${options.root}hbase.png`

router.get('/person', (req, res, next) => {
    if (req.query.name) {
        res.send(`You have requested the person ${req.query.name}`)        
    } else {
        let data = hexa2img(hexa)
        fs.writeFile(fileName, data, (err) => {
            if (err) throw err;
            console.log('The file has been saved!');
            res.sendFile(`hbase.png`, options, (err2) => {
                if (err2) {
                    next(err2)
                } else {
                    console.log('Sent: ', fileName)
                }
            })
            res.on('finish', function () {
                // Check if the file exists in the current directory.
                if (!fs.existsSync(fileName)) {
                    console.log(fileName, 'doesn\'t exist')
                } 
                else {
                    // Have to remove setTimout !!!!
                    setTimeout(function () {
                        try {
                            fs.unlinkSync(fileName);
                            console.log(fileName, 'was deleted');
                        } catch (e) {
                            console.log("error removing ", fileName);
                        }
                    }, 5000)
                }
            });
        });
    }
})

// Params property on the request object
// localhost:3000/person/Hamza
router.get('/person/:x/:y/:z', (req, res) => {
    res.send(`You have requested the params: ${req.params}`)
    console.log(req.params);
    
})

router.get('/error', (req, res) => {
    throw new Error('This is a forced error !')
})

function clean_hex(rowData) {
    rowData = rowData.toUpperCase();
    // Perform a (g) global, (i) case-insensitive replacement
    rowData = rowData.replace(/0x/gi, "");
    // Perform a (g) global replacement
    rowData = rowData.replace(/[^A-Fa-f0-9]/g, "");
    
    return rowData;
}

function hexa2img(hexa) {
    var cleaned_hex = clean_hex(hexa);

    if (cleaned_hex.length % 2) {
        alert("Error: cleaned hex string length is odd.");
        return;
    }

    var binary = new Array();
    for (var i = 0; i < cleaned_hex.length / 2; i++) {
        var h = cleaned_hex.substr(i * 2, 2);
        binary[i] = parseInt(h, 16);
    }

    var byteArray = new Uint8Array(binary);
    return byteArray
}


